import React from 'react';
import ReactDOM from 'react-dom/client';
import './styles.css'
import {add, sub, Multiply, Divide} from './App';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <div>
    <h1> Mathematical Operations !</h1>
    <h1> Addition : {add(5, 3)} </h1>
    <h1> Subtraction : {sub(5, 3)} </h1>
    <h1> Multiplication : {Multiply(3, 6)} </h1>
    <h1> Division : {Divide(6, 2)} </h1>
  </div>


);
